import React,{ Component } from 'react';
class Jumbotron extends Component{
    render(){
        return (
            <div className="jumbo">
            <div className="container">
            <div style={{position:"absolute", marginTop:"10vh"}} >
            <span className="bg-dark text-light" style={{fontSize:"4vh"}} >Welcome to अन्नPoorna Kitchen</span><br />
            <blockquote className="blockquote" style={{fontSize:"2.5vh"}}>Lorem Ipsum Dor Dodot Solor Amit<br />Blah blah blah my name is<br />Reshabh Shukla<br />Hello My Frands<br />Chai Peelo<br />Blah blah blah my name is<br />Reshabh Shukla<br />Hello My Frands<br />Chai Peelo
    <div style={{fontSize:"2.5vh",marginTop:"0px"}}><i className="fa fa-pepper-hot"><span> Fresh </span></i>
            <i className="fa fa-fire p-2"><span> Hot</span></i>
            <i className="fa fa-carrot"><span>Veg</span></i></div>
    </blockquote>
            <a href="Order"><button className="btn btn-success">Book a Meal!</button></a>
            </div>
            </div>
            <div>
            <img src="banner.jpg" style={{width:"100vw",height:"80vh"}} />
            </div>
            <div className="container text-center" id="rev">
            <em style={{fontSize:"56px"}}>People love <span className="text-success">our food</span></em>
            <br /><br /><br />
            </div>
            </div>

        );
    }
    }
    export default Jumbotron;
